import React, { useEffect, useMemo, useState } from 'react';
import { useTable } from 'react-table'
import axios from 'axios';
axios.defaults.withCredentials = true;

function HomeComp() {
    let [data, setData] = useState([]);

    useEffect(() => {
        axios.get("http://140.116.214.154:3000/api/data/first")
        .then(res => {
            setData(res.data);
        }).catch(res => {
        })
    }, [])

    const columns = useMemo(() => [{
        Header: "最新15筆資料",
        columns: [{
            name: '股票代號',
        },{
            name: '股票名稱',
        },{
            name: '資料日期',
        },{
            name: '提供者',
        },{
            name: '檔案下載',
            selector: row => row.filePath,
        },]
    }])
    const columns1 = [
        {
            name: '股票代號',
            selector: row => row.stockNum,
            sortable: true,
        },{
            name: '股票名稱',
            selector: row => row.stockName,
            sortable: true,
        },{
            name: '資料日期',
            selector: row => row.date,
            sortable: true,
        },{
            name: '提供者',
            selector: row => row.investmentCompany,
            sortable: true,
        },{
            name: '檔案下載',
            selector: row => row.filePath,
        },
    ];


    return (
        <div className = 'container-fluid'>
            <div className = 'col-md-8 offset-md-2'>
            </div>
        </div>
    );
}

export default HomeComp;
